import Item from './Item';
import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
    padding: 30px;
    display: flex;
    justify-content: center;
    flex-wrap: wrap;
    background-color: #ffffff;
    height: 100%;
`

export default function ListItem() {
    return (
        <div>

            <Container>
                <Item />
            </Container>

        </div>
    )
}
